d3.selectAll('svg circle.dotPoint').attr('r', 5);
d3.selectAll('.axis--x .tick text').text(function(d){return moment(d,i ).format('MMM')});
d3.selectAll('path.line').filter(function(d){return d[0].age_class == 'Petite enfance'}).style('stroke', '#d9d9d9');
d3.selectAll('path.line').filter(function(d){return d[0].age_class == 'Maternelle'}).style('stroke', '#bdbdbd');
d3.selectAll('path.line').filter(function(d){return d[0].age_class == 'Primaire'}).style('stroke', '#969696');
d3.selectAll('path.line').filter(function(d){return d[0].age_class == 'Collège'}).style('stroke', '#636363');
d3.selectAll('path.line').filter(function(d){return d[0].age_class == 'Lycée'}).style('stroke', '#252525');

d3.selectAll('svg text.label').filter(function(d){return d.age_class == 'Petite enfance'}).style('fill', '#d9d9d9');
d3.selectAll('svg text.label').filter(function(d){return d.age_class == 'Maternelle'}).style('fill', '#bdbdbd');
d3.selectAll('svg text.label').filter(function(d){return d.age_class == 'Primaire'}).style('fill', '#969696');
d3.selectAll('svg text.label').filter(function(d){return d.age_class == 'Collège'}).style('fill', '#636363');
d3.selectAll('svg text.label').filter(function(d){return d.age_class == 'Lycée'}).style('fill', '#252525');
